import React,{ useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [todolist, settodo] = useState({items: []})

  useEffect( () => {
    axios.get('todos')
      .then(res => {
        settodo(items = res.data);
      })
      .catch(err => {
        console.log(err)
      })

  },[todolist])
  return (
    <div>
      <p> Todos</p>
        {
          todolist.items.map(data => <p>data.title</p>)
        }
    </div>
  );
}

export default App;
